import React from "react";

export default function SubNav(props) {
  const { currentUser } = props;

  return (
    <div>
      <Link to="/myaccount">
        <p>My Posts</p>
      </Link>
      <Link to="/newpost">
        <p>New Post</p>
      </Link>
      <Link to="/myfavorites">
        <p>My Favorites</p>
      </Link>
    </div>
  );
}
